```js
const blips = alt.Blip.all; // Store it in a variable, so it doesn't create a copy of the array on each iteration
for(let i = 0; i < blips.length; i++)
{
  alt.log(`${blips[i].scriptID}`); // Logs the scriptID of every blip
}
```

